import React from 'react';
import ReactDOM from 'react-dom';

function App() {
  return(
    <div>
      <h1> Hello Word </h1>
      <ul>
        <li> Facebook </li>
        <li> Youtube </li>
      </ul>
    </div>
  );
}
ReactDOM.render(<h1>Hello Word</h1>,document.getElementById('root'));
